const isEmpty = function (stack) {
  return stack.length === 0;
};

const isOpeningParenthesis = function (character) {
  return '([{'.includes(character);
};

const isClosingParenthesis = function (character) {
  return ')]}'.includes(character);
};

const isPair = function (openingParenthesis, closingParenthesis) {
  const pairs = '(),[],{}';
  return pairs.includes(openingParenthesis + closingParenthesis);
};

const areBalancedParentheses = function (text) {
  const stack = [];
  for (let index = 0; index < text.length; index++) {
    if (isOpeningParenthesis(text[index])) { stack.push(text[index]); }
    if (isClosingParenthesis(text[index])) {
      if (isEmpty(stack)) { return false; }
      if (!isPair(stack.pop(), text[index])) { return false; }
    }
  }
  return isEmpty(stack);
};

exports.areBalancedParentheses = areBalancedParentheses;

