const addToChunks = function (size, partitions, element) {
  const lastPartition = partitions[partitions.length - 1];
  if (lastPartition.length >= size) {
    partitions.push([element]);
    return partitions;
  }
  lastPartition.push(element);
  return partitions;
};

const partition = function (collection, size) {
  if (collection.length === 0 || size < 1) {
    return [];
  }
  return collection.reduce(function (partitions, element) {
    return addToChunks(size, partitions, element);
  }, [[]]);
};

