const addToChunk = function (partitions, element, size, overlap) {
  let lastPartition = partitions[partitions.length - 1];
  if (lastPartition.length === size) {
    lastPartition = lastElements(lastPartition, overlap);
    partitions.push(lastPartition);
  }
  lastPartition.push(element);
  return partitions;
};

const partition = function (collection, size, overlap) {
  if (overlap >= size || collection.length === 0) {
    return [];
  }
  return collection.reduce(function (partitions, element) {
    return addToChunk(partitions, element, size, overlap);
  }, [[]]);
};

