const reduce = function (list, reducer, context) {
  let start = 0;
  if (context === undefined) {
    context = list[0];
    start = 1;
  }
  for (let index = start; index < list.length; index++) {
    context = reducer(context, list[index], index, list);
  }
  return context;
};

