const decimalToBinary = function (decimal) {
  let currentNumber = decimal;
  let binary = '';

  while (currentNumber > 0) {
    const remainder = currentNumber % 2;
    binary = remainder + binary;
    currentNumber = Math.floor(currentNumber / 2);
  }
  return binary;
};

const numOfSubsets = function (set) {
  return Math.pow(2, set.length);
};

const prependWithZeros = function (text, length) {
  return text.padStart(length, 0);
};

const subgroup = function (binarySet, set) {
  const subset = [];

  for (let index = 0; index < binarySet.length; index++) {
    if (binarySet[index] === '1') {
      subset.push(set[index]);
    }
  }
  return subset;
};

const subsets = function (set) {
  const fragments = [];

  for (let index = 0; index < numOfSubsets(set); index++) {
    const binary = prependWithZeros(decimalToBinary(index), set.length);
    fragments.push(subgroup(binary, set));
  }
  return fragments;
};

