  testAreBalancedParentheses(')(', false, 'A pair of unbalanced parantheses.');
  testAreBalancedParentheses('(()', false, 'Three paranthesis combination: (()');
  testAreBalancedParentheses('())', false, 'Three paranthesis combination: ())');
  testAreBalancedParentheses('()(', false, 'Three paranthesis combination: ()(');
  testAreBalancedParentheses(')()', false, 'Three paranthesis combination: )()');
  testAreBalancedParentheses('()()', true, 'Two pairs of balanced parantheses.');
  testAreBalancedParentheses(')()(', false, 'Unbalanced parantheses pairs: )()(.');
  testAreBalancedParentheses(')(()', false, 'Unbalanced parantheses pairs: )(().');
  testAreBalancedParentheses('())(', false, 'Unbalanced parantheses pairs: ())(.');
  testAreBalancedParentheses('(())', true, 'One level of nesting of balanced parantheses.');
  testAreBalancedParentheses('((()))', true, 'Two level of nesting of balanced parantheses.');
  testAreBalancedParentheses('(((()())))', true, 'Balanced parantheses.: (((()())))');
