const addIfAbsent = function (set, element) {
  for (let index = 0; index < set.length; index++) {
    if (element === set[index]) {
      return set;
    }
  }
  set.push(element);
  return set;
};

const uniqueElements = function (list) {
  return list.reduce(addIfAbsent, []);
};

